export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},ZuutAMfh3o:{data:{id:248,attributes:{imdbId:"tt0057877",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BM2MyYTg5MDAtNjVlNy00MzZkLTgxOGQtMzVkZTdlYWNiYzUyXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.8\u002F10"},{Source:"Rotten Tomatoes",Value:"76%"},{Source:"Metacritic",Value:"68\u002F100"}],item_lang:{data:{id:911,attributes:{title:a,plot:"Debauched King Henry II (Peter O'Toole) installs his longtime court facilitator Thomas Becket (Richard Burton) as the Archbishop of Canterbury, assuming that his old friend will be a compliant and loyal lackey in the King's on-going battles with the church. But Becket unexpectedly finds his true calling on the ecclesiastical side, and aligns himself against the King's selfish wishes, causing a rift and an eventual showdown not only between the two men, but also the institutions they represent.",slug:"becket"}}},books:{data:[{id:2760,attributes:{title:a,description:"The celebrated play that draws from historical events in the Norman conquest of England to create a profound portrait of a man's soul—and a transcendent vision of the human spirit From its powerful opening scene, of a naked King Henry II praying at the tomb of Thomas Becket, to the final wrenching act of ultimate self-sacrifice, Jean Anouilh's Becket remains a towering achievement in the history of the theatre. Winner of the Antoinette Perry Award for Best Play of the Season, Anouilh's monumental work—introduced in this edition by the acclaimed writer and critic Andre Aciman—draws from historical events in the Norman conquest of England to paint a profound and enduring portrait of the saint and martyr.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QqhzLzRIMb8C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1995-09-01",publisher:"Riverhead Books",subtitle:e}},{id:2761,attributes:{title:a,description:"When the Archbishop of Canterbury died, Henry II forced his companion and political lieutenant, Thomas Becket, to take his place. Becket told his King: 'If I become archbishop, I shall cease to be your friend.' Becket, who with Henry had fought the Church for the good of the State, now felt responsible for the honour of God. Conflict was inevitable and was followed, just as inevitably, by murder and remorse. This translation by Frederic and Stephen Raphael of Jean Anouilh's Becket premiered at the Theatre Royal Haymarket, London, in October 2004.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bTllAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2004-10-28",publisher:"Methuen Drama",subtitle:e}},{id:2762,attributes:{title:a,description:"Portrays the conflict of loyalties to church and state as they influenced the lives of two powerful men in English history.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OJ4eL_e4oHMC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1960-01-01",publisher:"Perigee Books",subtitle:"Or the Honor of God"}},{id:2763,attributes:{title:a,description:"Radical new translation of the Jean Anouilh classic",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WktgzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1961-01-01",publisher:"Samuel French Limited",subtitle:"Or, The Honour of God"}},{id:2764,attributes:{title:"The Theatre of Jean Anouilh",description:"This introductory survey for those unfamiliar with Anouilh covers the whole of his work, up to and including the most recent plays available at the time of writing. It also attempts to counter the prevailing criticisms of Anouilh's work and suggest the basis for a new understanding and fundamental reappraisal of his place and importance in the contemporary French theatre.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=U8rvAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["H. G. McIntyre",b],firstBook:d,published:"1981-01-01",publisher:"Totowa, N.J. : Barnes & Noble",subtitle:e}}]}}},meta:{}}},prerenderedAt:1682568371203}}("Becket","Jean Anouilh","movie",null,"","series",1))